import React from 'react';
// import UniversityData from './universities.json';
import ReactDOM from 'react-dom';
import axios from 'axios';

class UniversityList extends React.Component {


    state = {
        values: []
    }

    componentDidMount() {
        fetch('/api/university')
            .then(function (res) {
                return res.json();
            }).then(function (json) {
                this.setState({
                    values: json
                })
            })
    }

    UniversityData() {
        fetch('/api/university')
            .then(function (res) {
                return res.json();
            }).then(function (json) {
                this.setState({
                    values: json
                })
            })
    }
    render() {
        return (
            <ul>
                {this.state.items.map(function (item, index) {
                    return (
                        <div>
                            <h1>{item.name}</h1>
                            <p>{item._id}</p>
                        </div>
                    )
                })}
            </ul>
        )

    }
}

export default UniversityList;
